import React, {useState,useEffect} from "react";


const Home = ()=>{

    const [data , setData]=useState({});
    const submit = ()=>{
        fetch("/Get").then(response =>{response.json()})
        .then(data=>{setData(data)})
        .catch(err=>console.log(err));
        console.log(data);
    };

    return (
        <div>Home
        <button onClick={submit()}>Click</button>
        </div>
    )
};

export default Home;
